import React from 'react';
import ReactDOM from 'react-dom';
import "./Navbar.css"
function Navbar() {
  return (
    <div>
    <nav class="navbar navbar-light bg-light  ">
  <div class="container-fluid ">
   <h1 className="logo"> Todo</h1>
  </div>
</nav>
    </div>
  );
}
export default Navbar;
